import React, { Component } from "react";
import Link from "next/link";
import { Navbar, Nav, NavDropdown, Form, FormControl, Button } from 'react-bootstrap';
import ReactCarousels from './common/Carousels'

class Home extends Component {
    render() {
        const href = {
            pathname: "/about",
            query: { name: "next" }
        }
        // the path inside pages directory + query string

        const as = {
            pathname: "/about/next",
            hash: "title-1"
        }
        // the path that will be rendered in the browser URL bar.
        return (
            <React.Fragment>
                <div>
                    <Navbar bg="light" expand="lg">
                        <Navbar.Brand>Next.js</Navbar.Brand>
                        <Nav className="mr-auto">
                            <Nav.Link href="#home">Home</Nav.Link>
                            <Nav.Link href="/Contact" replace>
                                Contact
                                </Nav.Link>
                            <Nav.Link href="/about">About</Nav.Link>
                            <Nav.Link href="/blog">Blog</Nav.Link>
                        </Nav>
                        <Form inline>
                            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                            <Button >Search</Button>
                        </Form>
                    </Navbar>

                    {/* <h1>NEXT.JS</h1> */}


                </div>
                <div >
                    <ReactCarousels />
                </div>
                <style jsx>
                        {`
                        h1{
                            color: #006ae6;
                            text-align:center;
                            padding:10%
                        }
                        div{
                            background: white
                        }
                        a{
                            font-size:20px;
                            color:black;
                            text-decoration:none
                        }
                    `}

                    </style>
                    <style global jsx>
                        {`
                            body{
                                background:white
                            }
                        `}
                    </style>
            </React.Fragment>

        )
    }
}

export default Home
